  return (
    <div>
      {/* routing and many more */}
      {/* <h2>I AM STARTING </h2> */}
      <Route path="/welcome">
        <Welcome />
      </Route>
      <Route path="/products">
        <Products />
      </Route>
    </div>
  );
}

